import React, { useEffect, useState } from 'react';
import { BrowserRouter, Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Sidebar from './defultComponent/sidebar';
import RouterA from './defultComponent/router';
import { render } from '@testing-library/react';

export default function App() {
  return (
    <div>
      <Sidebar />
      <BrowserRouter>
        <Router>
          <Routes>
            <Route path='/' />
            <Route path='/menu' />
          </Routes>
        </Router>
      </BrowserRouter>
    </div>
  )
}
